import React from 'react'
import { Link } from 'react-router-dom';
import './VideoCard.css';

export const VideoCard = (props) => {

    return (
        <div className="card">
            <img src={props.videoData.cover} alt={props.videoData.title}/>
           <div className="card-info">
               <label>Title</label>
            <label>{props.videoData.title}</label>
            <label>Duration</label>
           <label>{props.videoData.duration} min.</label>
           <label>Section</label>
           <label>{props.videoData.section}</label>

           </div>
            {props.videoData.fav ? 'yes' : 'not'}
            <Link to={`video/${props.videoData.id}`}> ver
            </Link>          
        </div>
    )
}
